import React from "react";
import styled from "styled-components";
import '../App.css';

const Title = styled.div`

    color:#FFFFFF;
    font-family: "Montserrat";
    font-size: 40px;
    font-weight: 600;
    line-height: 19px;
    text-align: left;
    width:10%;
    height:33px;

`;

const Subtitle = styled.div`

    color:#FFFFFF;
    font-family: Montserrat;
    font-size: 20px;
    font-weight: 300;
    line-height: 19px;
    text-align: left;
    width:10%
 
`;


const Head = (props:any) => {



    return(
        <div style={{flex:1, backgroundColor:"#0F52BA", width:"100%", height:"101px", alignItems:'center', justifyContent:'center' }}>
                <Title>
                    MKS
                </Title>
                <Subtitle>
                    Sistemas
                </Subtitle>
        </div>
    )

}

export default Head;
